import React from "react";
import App from "../App";
import Layout from "../Layout"

const routeApp = () => {
return (
    <Route>
        <Route path="/" exact>
        {/* Đây là cái đường dẫn, */}
        <App />
        {/* đây là vị trí cần nó hiện nội dung đường dẫn tới trang đó */}
      </Route>
      <Route path="/layout">
        <Layout />
      </Route>
    </Route>
)
};
export default React.memo(routeApp);
